import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import Chat from "./pages/chat/chat";

function App() {
  return (
      <div className="App">
        <Router>
          <Routes>
            <Route path="/chat">
              <Chat />
            </Route>
          </Routes>
        </Router>
      </div>
  );
}

export default App;
